(1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"typer_color\":null,\"text_color\":null,\"button_bg_color\":null,\"button_text_color\":null,\"section_title\":{\"en\":\"Simple Shipping Worldwide\",\"ger\":\"Einfacher Versand weltweit\",\"fr\":\"Exp\\u00e9dition simple dans le monde entier\",\"tr\":\"D\\u00fcnya \\u00c7ap\\u0131nda Basit Nakliye\",\"pt\":\"Envio simples para todo o mundo\",\"ar\":\"\\u0628\\u0633\\u064a\\u0637 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0641\\u064a \\u062c\\u0645\\u064a\\u0639 \\u0623\\u0646\\u062d\\u0627\\u0621 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645\",\"bn\":\"\\u09ac\\u09bf\\u09b6\\u09cd\\u09ac\\u09ac\\u09cd\\u09af\\u09be\\u09aa\\u09c0 \\u09b8\\u09b9\\u099c \\u09b6\\u09bf\\u09aa\\u09bf\\u0982\",\"ru\":\"\\u041f\\u0440\\u043e\\u0441\\u0442\\u0430\\u044f \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0430 \\u043f\\u043e \\u0432\\u0441\\u0435\\u043c\\u0443 \\u043c\\u0438\\u0440\\u0443\",\"es\":\"Env\\u00edo sencillo a todo el mundo\",\"zh\":\"\\u5168\\u7403\\u7b80\\u5355\\u8fd0\\u8f93\"},\"section_description\":{\"en\":\"Why limit your business with just domestic sales? It is easy to expand the boundaries and work at new areas with us.\",\"ger\":\"Warum sollten Sie Ihr Gesch\\u00e4ft nur auf Inlandsverk\\u00e4ufe beschr\\u00e4nken? Es ist einfach, mit uns die Grenzen zu erweitern und neue Bereiche zu erschlie\\u00dfen.\",\"fr\":\"Pourquoi limiter votre activit\\u00e9 aux seules ventes nationales\\u00a0? Il est facile d\'\\u00e9largir les fronti\\u00e8res et de travailler avec nous dans de nouveaux domaines.\",\"tr\":\"Neden i\\u015finizi sadece yurti\\u00e7i sat\\u0131\\u015flarla s\\u0131n\\u0131rlayas\\u0131n\\u0131z? Bizimle s\\u0131n\\u0131rlar\\u0131 geni\\u015fletmek ve yeni alanlarda \\u00e7al\\u0131\\u015fmak \\u00e7ok kolay.\",\"pt\":\"Por que limitar seu neg\\u00f3cio apenas com vendas dom\\u00e9sticas? \\u00c9 f\\u00e1cil expandir os limites e trabalhar em novas \\u00e1reas conosco.\",\"ar\":\"\\u0644\\u0645\\u0627\\u0630\\u0627 \\u062a\\u0642\\u0635\\u0631 \\u0639\\u0645\\u0644\\u0643 \\u0628\\u0627\\u0644\\u0645\\u0628\\u064a\\u0639\\u0627\\u062a \\u0627\\u0644\\u0645\\u062d\\u0644\\u064a\\u0629 \\u0641\\u0642\\u0637\\u061f \\u0645\\u0646 \\u0627\\u0644\\u0633\\u0647\\u0644 \\u062a\\u0648\\u0633\\u064a\\u0639 \\u0627\\u0644\\u062d\\u062f\\u0648\\u062f \\u0648\\u0627\\u0644\\u0639\\u0645\\u0644 \\u0645\\u0639\\u0646\\u0627 \\u0641\\u064a \\u0645\\u0646\\u0627\\u0637\\u0642 \\u062c\\u062f\\u064a\\u062f\\u0629.\",\"bn\":\"\\u0995\\u09c7\\u09a8 \\u09b6\\u09c1\\u09a7\\u09c1 \\u0997\\u09be\\u09b0\\u09cd\\u09b9\\u09b8\\u09cd\\u09a5\\u09cd\\u09af \\u09ac\\u09bf\\u0995\\u09cd\\u09b0\\u09af\\u09bc \\u09b8\\u0999\\u09cd\\u0997\\u09c7 \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09ac\\u09cd\\u09af\\u09ac\\u09b8\\u09be \\u09b8\\u09c0\\u09ae\\u09be\\u09ac\\u09a6\\u09cd\\u09a7? \\u09b8\\u09c0\\u09ae\\u09be\\u09a8\\u09be \\u09aa\\u09cd\\u09b0\\u09b8\\u09be\\u09b0\\u09bf\\u09a4 \\u0995\\u09b0\\u09be \\u098f\\u09ac\\u0982 \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b8\\u09be\\u09a5\\u09c7 \\u09a8\\u09a4\\u09c1\\u09a8 \\u098f\\u09b2\\u09be\\u0995\\u09be\\u09af\\u09bc \\u0995\\u09be\\u099c \\u0995\\u09b0\\u09be \\u09b8\\u09b9\\u099c\\u0964\",\"ru\":\"\\u0417\\u0430\\u0447\\u0435\\u043c \\u043e\\u0433\\u0440\\u0430\\u043d\\u0438\\u0447\\u0438\\u0432\\u0430\\u0442\\u044c \\u0441\\u0432\\u043e\\u0439 \\u0431\\u0438\\u0437\\u043d\\u0435\\u0441 \\u0442\\u043e\\u043b\\u044c\\u043a\\u043e \\u0432\\u043d\\u0443\\u0442\\u0440\\u0435\\u043d\\u043d\\u0438\\u043c\\u0438 \\u043f\\u0440\\u043e\\u0434\\u0430\\u0436\\u0430\\u043c\\u0438? \\u0421 \\u043d\\u0430\\u043c\\u0438 \\u043b\\u0435\\u0433\\u043a\\u043e \\u0440\\u0430\\u0441\\u0448\\u0438\\u0440\\u044f\\u0442\\u044c \\u0433\\u0440\\u0430\\u043d\\u0438\\u0446\\u044b \\u0438 \\u0440\\u0430\\u0431\\u043e\\u0442\\u0430\\u0442\\u044c \\u043d\\u0430\\u0434 \\u043d\\u043e\\u0432\\u044b\\u043c\\u0438 \\u043d\\u0430\\u043f\\u0440\\u0430\\u0432\\u043b\\u0435\\u043d\\u0438\\u044f\\u043c\\u0438.\",\"es\":\"\\u00bfPor qu\\u00e9 limitar su negocio solo a las ventas nacionales? Es f\\u00e1cil expandir los l\\u00edmites y trabajar en nuevas \\u00e1reas con nosotros.\",\"zh\":\"\\u4e3a\\u4ec0\\u4e48\\u8981\\u9650\\u5236\\u60a8\\u7684\\u4e1a\\u52a1\\u4ec5\\u9650\\u4e8e\\u56fd\\u5185\\u9500\\u552e\\uff1f \\u4e0e\\u6211\\u4eec\\u4e00\\u8d77\\u6269\\u5c55\\u8fb9\\u754c\\u5e76\\u5728\\u65b0\\u9886\\u57df\\u5de5\\u4f5c\\u5f88\\u5bb9\\u6613\\u3002\"},\"section_description1\":{\"en\":\"Show off your product to the world! Get international shipping prices that best suit your needs and budget and start shipping internationally with a push of a button.\",\"ger\":\"Pr\\u00e4sentieren Sie Ihr Produkt der Welt! Erhalten Sie internationale Versandpreise, die Ihren Bed\\u00fcrfnissen und Ihrem Budget am besten entsprechen, und beginnen Sie mit einem Knopfdruck mit dem internationalen Versand.\",\"fr\":\"Montrez votre produit au monde\\u00a0! Obtenez des tarifs d\'exp\\u00e9dition internationaux qui correspondent le mieux \\u00e0 vos besoins et \\u00e0 votre budget et commencez \\u00e0 exp\\u00e9dier \\u00e0 l\'international en appuyant simplement sur un bouton.\",\"tr\":\"\\u00dcr\\u00fcn\\u00fcn\\u00fcz\\u00fc d\\u00fcnyaya g\\u00f6sterin! \\u0130htiya\\u00e7lar\\u0131n\\u0131za ve b\\u00fct\\u00e7enize en uygun uluslararas\\u0131 nakliye fiyatlar\\u0131n\\u0131 al\\u0131n ve bir d\\u00fc\\u011fmeye basarak uluslararas\\u0131 nakliyeye ba\\u015flay\\u0131n.\",\"pt\":\"Mostre seu produto para o mundo! Obtenha os pre\\u00e7os de envio internacional que melhor atendem \\u00e0s suas necessidades e or\\u00e7amento e comece a enviar internacionalmente com o apertar de um bot\\u00e3o.\",\"ar\":\"\\u0627\\u0639\\u0631\\u0636 \\u0645\\u0646\\u062a\\u062c\\u0643 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645! \\u0627\\u062d\\u0635\\u0644 \\u0639\\u0644\\u0649 \\u0623\\u0633\\u0639\\u0627\\u0631 \\u0634\\u062d\\u0646 \\u062f\\u0648\\u0644\\u064a\\u0629 \\u062a\\u0646\\u0627\\u0633\\u0628 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a\\u0643 \\u0648\\u0645\\u064a\\u0632\\u0627\\u0646\\u064a\\u062a\\u0643 \\u0639\\u0644\\u0649 \\u0623\\u0641\\u0636\\u0644 \\u0648\\u062c\\u0647 \\u0648\\u0627\\u0628\\u062f\\u0623 \\u0641\\u064a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u062f\\u0648\\u0644\\u064a\\u064b\\u0627 \\u0628\\u0636\\u063a\\u0637\\u0629 \\u0632\\u0631.\",\"bn\":\"\\u09ac\\u09bf\\u09b6\\u09cd\\u09ac\\u09c7\\u09b0 \\u0995\\u09be\\u099b\\u09c7 \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09aa\\u09a3\\u09cd\\u09af \\u09a6\\u09c7\\u0996\\u09be\\u09a8! \\u0986\\u09a8\\u09cd\\u09a4\\u09b0\\u09cd\\u099c\\u09be\\u09a4\\u09bf\\u0995 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09ae\\u09c2\\u09b2\\u09cd\\u09af\\u0997\\u09c1\\u09b2\\u09bf \\u09aa\\u09be\\u09a8 \\u09af\\u09be \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u099a\\u09be\\u09b9\\u09bf\\u09a6\\u09be \\u098f\\u09ac\\u0982 \\u09ac\\u09be\\u099c\\u09c7\\u099f\\u09c7\\u09b0 \\u09b8\\u09be\\u09a5\\u09c7 \\u09b8\\u09ac\\u099a\\u09c7\\u09af\\u09bc\\u09c7 \\u0989\\u09aa\\u09af\\u09c1\\u0995\\u09cd\\u09a4 \\u098f\\u09ac\\u0982 \\u098f\\u0995\\u099f\\u09bf \\u09ac\\u09cb\\u09a4\\u09be\\u09ae\\u09c7 \\u099a\\u09be\\u09aa \\u09a6\\u09bf\\u09af\\u09bc\\u09c7 \\u0986\\u09a8\\u09cd\\u09a4\\u09b0\\u09cd\\u099c\\u09be\\u09a4\\u09bf\\u0995\\u09ad\\u09be\\u09ac\\u09c7 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b6\\u09c1\\u09b0\\u09c1 \\u0995\\u09b0\\u09c1\\u09a8\\u09f7\",\"ru\":\"\\u041f\\u043e\\u043a\\u0430\\u0436\\u0438\\u0442\\u0435 \\u0441\\u0432\\u043e\\u0439 \\u043f\\u0440\\u043e\\u0434\\u0443\\u043a\\u0442 \\u043c\\u0438\\u0440\\u0443! \\u041f\\u043e\\u043b\\u0443\\u0447\\u0438\\u0442\\u0435 \\u0446\\u0435\\u043d\\u044b \\u043d\\u0430 \\u043c\\u0435\\u0436\\u0434\\u0443\\u043d\\u0430\\u0440\\u043e\\u0434\\u043d\\u0443\\u044e \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0443, \\u043a\\u043e\\u0442\\u043e\\u0440\\u044b\\u0435 \\u043d\\u0430\\u0438\\u043b\\u0443\\u0447\\u0448\\u0438\\u043c \\u043e\\u0431\\u0440\\u0430\\u0437\\u043e\\u043c \\u0441\\u043e\\u043e\\u0442\\u0432\\u0435\\u0442\\u0441\\u0442\\u0432\\u0443\\u044e\\u0442 \\u0432\\u0430\\u0448\\u0438\\u043c \\u043f\\u043e\\u0442\\u0440\\u0435\\u0431\\u043d\\u043e\\u0441\\u0442\\u044f\\u043c \\u0438 \\u0431\\u044e\\u0434\\u0436\\u0435\\u0442\\u0443, \\u0438 \\u043d\\u0430\\u0447\\u043d\\u0438\\u0442\\u0435 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0443 \\u043f\\u043e \\u0432\\u0441\\u0435\\u043c\\u0443 \\u043c\\u0438\\u0440\\u0443 \\u043e\\u0434\\u043d\\u0438\\u043c \\u043d\\u0430\\u0436\\u0430\\u0442\\u0438\\u0435\\u043c \\u043a\\u043d\\u043e\\u043f\\u043a\\u0438.\",\"es\":\"\\u00a1Muestre su producto al mundo! Obtenga los precios de env\\u00edo internacional que mejor se adapten a sus necesidades y presupuesto y comience a realizar env\\u00edos internacionales con solo presionar un bot\\u00f3n.\",\"zh\":\"\\u5411\\u4e16\\u754c\\u5c55\\u793a\\u60a8\\u7684\\u4ea7\\u54c1\\uff01 \\u83b7\\u53d6\\u6700\\u9002\\u5408\\u60a8\\u7684\\u9700\\u6c42\\u548c\\u9884\\u7b97\\u7684\\u56fd\\u9645\\u8fd0\\u8f93\\u4ef7\\u683c\\uff0c\\u53ea\\u9700\\u6309\\u4e00\\u4e0b\\u6309\\u94ae\\u5373\\u53ef\\u5f00\\u59cb\\u56fd\\u9645\\u8fd0\\u8f93\\u3002\"},\"section_button\":{\"en\":\"Let\\u2019s get global!\",\"ger\":\"Lassen Sie uns global werden!\",\"fr\":\"Soyons mondiaux\\u00a0!\",\"tr\":\"K\\u00fcreselle\\u015felim!\",\"pt\":\"Vamos globalizar!\",\"ar\":\"\\u0641\\u0644\\u0646\\u0643\\u0646 \\u0639\\u0627\\u0644\\u0645\\u064a\\u064a\\u0646!\",\"bn\":\"\\u0986\\u09b8\\u09c1\\u09a8 \\u09ac\\u09bf\\u09b6\\u09cd\\u09ac\\u09ac\\u09cd\\u09af\\u09be\\u09aa\\u09c0 \\u09aa\\u09c7\\u09a4\\u09c7!\",\"ru\":\"\\u0414\\u0430\\u0432\\u0430\\u0439\\u0442\\u0435 \\u0433\\u043b\\u043e\\u0431\\u0430\\u043b\\u044c\\u043d\\u043e!\",\"es\":\"\\u00a1Seamos globales!\",\"zh\":\"\\u8ba9\\u6211\\u4eec\\u8d70\\u5411\\u5168\\u7403\\uff01\"},\"section_url\":{\"type\":\"custom\",\"custom\":\"#\",\"page\":null,\"category\":null,\"post\":null}}', 'globus', 'homepage', NULL, 11, 'qwintry', 5, '2022-05-25 15:58:47', '2022-06-14 05:19:58'),
(1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"button_bg_color\":null,\"button_bg_color1\":null,\"button_text_color1\":null,\"button_text_color\":null,\"section_title\":{\"en\":\"Simple Integration\",\"ger\":\"Einfache Integration\",\"fr\":\"Int\\u00e9gration simple\",\"tr\":\"Basit Entegrasyon\",\"pt\":\"Integra\\u00e7\\u00e3o simples\",\"ar\":\"\\u062a\\u0643\\u0627\\u0645\\u0644 \\u0628\\u0633\\u064a\\u0637\",\"bn\":\"\\u09b8\\u09b9\\u099c \\u0987\\u09a8\\u09cd\\u099f\\u09bf\\u0997\\u09cd\\u09b0\\u09c7\\u09b6\\u09a8\",\"ru\":\"\\u041f\\u0440\\u043e\\u0441\\u0442\\u0430\\u044f \\u0438\\u043d\\u0442\\u0435\\u0433\\u0440\\u0430\\u0446\\u0438\\u044f\",\"es\":\"Integraci\\u00f3n sencilla\",\"zh\":\"\\u7b80\\u5355\\u96c6\\u6210\"},\"section_description\":{\"en\":\"Perfectly documented API layer and slick interface for humans. Shipping software is easy to use everywhere: you need nothing to download or install. Easily integrate with our payment system. Integration modules for popular ecommerce engines (coming soon).\",\"ger\":\"Perfekt dokumentierte API-Schicht und glatte Schnittstelle f\\u00fcr Menschen. Die Versandsoftware ist \\u00fcberall einfach zu verwenden: Sie m\\u00fcssen nichts herunterladen oder installieren. Einfache Integration in unser Zahlungssystem. Integrationsmodule f\\u00fcr beliebte E-Commerce-Engines (bald verf\\u00fcgbar).\",\"fr\":\"Couche API parfaitement document\\u00e9e et interface fluide pour les humains. Le logiciel d\'exp\\u00e9dition est facile \\u00e0 utiliser partout : vous n\'avez besoin de rien \\u00e0 t\\u00e9l\\u00e9charger ou \\u00e0 installer. Int\\u00e9grez facilement \\u00e0 notre syst\\u00e8me de paiement. Modules d\'int\\u00e9gration pour les moteurs de commerce \\u00e9lectronique populaires (\\u00e0 venir).\",\"tr\":\"\\u0130nsanlar i\\u00e7in m\\u00fckemmel bir \\u015fekilde belgelenmi\\u015f API katman\\u0131 ve kaygan aray\\u00fcz. G\\u00f6nderim yaz\\u0131l\\u0131m\\u0131n\\u0131n her yerde kullan\\u0131m\\u0131 kolayd\\u0131r: \\u0130ndirmek veya y\\u00fcklemek i\\u00e7in hi\\u00e7bir \\u015feye ihtiyac\\u0131n\\u0131z yoktur. \\u00d6deme sistemimizle kolayca entegre edin. Pop\\u00fcler e-ticaret motorlar\\u0131 i\\u00e7in entegrasyon mod\\u00fclleri (\\u00e7ok yak\\u0131nda).\",\"pt\":\"Camada de API perfeitamente documentada e interface elegante para humanos. O software de envio \\u00e9 f\\u00e1cil de usar em qualquer lugar: voc\\u00ea n\\u00e3o precisa baixar ou instalar nada. Integre-se facilmente ao nosso sistema de pagamento. M\\u00f3dulos de integra\\u00e7\\u00e3o para mecanismos populares de com\\u00e9rcio eletr\\u00f4nico (em breve).\",\"ar\":\"\\u0637\\u0628\\u0642\\u0629 API \\u0645\\u0648\\u062b\\u0642\\u0629 \\u062a\\u0645\\u0627\\u0645\\u064b\\u0627 \\u0648\\u0648\\u0627\\u062c\\u0647\\u0629 \\u0623\\u0646\\u064a\\u0642\\u0629 \\u0644\\u0644\\u0628\\u0634\\u0631. \\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0633\\u0647\\u0644 \\u0627\\u0644\\u0627\\u0633\\u062a\\u062e\\u062f\\u0627\\u0645 \\u0641\\u064a \\u0643\\u0644 \\u0645\\u0643\\u0627\\u0646: \\u0644\\u0627 \\u062a\\u062d\\u062a\\u0627\\u062c \\u0625\\u0644\\u0649 \\u062a\\u0646\\u0632\\u064a\\u0644 \\u0623\\u0648 \\u062a\\u062b\\u0628\\u064a\\u062a \\u0623\\u064a \\u0634\\u064a\\u0621. \\u062a\\u062a\\u0643\\u0627\\u0645\\u0644 \\u0628\\u0633\\u0647\\u0648\\u0644\\u0629 \\u0645\\u0639 \\u0646\\u0638\\u0627\\u0645 \\u0627\\u0644\\u062f\\u0641\\u0639 \\u0644\\u062f\\u064a\\u0646\\u0627. \\u0648\\u062d\\u062f\\u0627\\u062a \\u062a\\u0643\\u0627\\u0645\\u0644 \\u0644\\u0645\\u062d\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629 \\u0627\\u0644\\u0634\\u0647\\u064a\\u0631\\u0629 (\\u0642\\u0631\\u064a\\u0628\\u064b\\u0627).\",\"bn\":\"\\u09ae\\u09be\\u09a8\\u09c1\\u09b7\\u09c7\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u09a8\\u09bf\\u0996\\u09c1\\u0981\\u09a4\\u09ad\\u09be\\u09ac\\u09c7 \\u09a8\\u09a5\\u09bf\\u09ad\\u09c1\\u0995\\u09cd\\u09a4 API \\u09b8\\u09cd\\u09a4\\u09b0 \\u098f\\u09ac\\u0982 \\u099a\\u099f\\u0995\\u09a6\\u09be\\u09b0 \\u0987\\u09a8\\u09cd\\u099f\\u09be\\u09b0\\u09ab\\u09c7\\u09b8\\u0964 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b8\\u09ab\\u09cd\\u099f\\u0993\\u09af\\u09bc\\u09cd\\u09af\\u09be\\u09b0 \\u09b8\\u09b0\\u09cd\\u09ac\\u09a4\\u09cd\\u09b0 \\u09ac\\u09cd\\u09af\\u09ac\\u09b9\\u09be\\u09b0 \\u0995\\u09b0\\u09be \\u09b8\\u09b9\\u099c: \\u09a1\\u09be\\u0989\\u09a8\\u09b2\\u09cb\\u09a1 \\u09ac\\u09be \\u0987\\u09a8\\u09b8\\u09cd\\u099f\\u09b2 \\u0995\\u09b0\\u09be\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u0995\\u09bf\\u099b\\u09c1\\u0987 \\u09b2\\u09be\\u0997\\u09ac\\u09c7 \\u09a8\\u09be\\u0964 \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09aa\\u09c7\\u09ae\\u09c7\\u09a8\\u09cd\\u099f \\u09b8\\u09bf\\u09b8\\u09cd\\u099f\\u09c7\\u09ae\\u09c7\\u09b0 \\u09b8\\u09be\\u09a5\\u09c7 \\u09b8\\u09b9\\u099c\\u09c7\\u0987 \\u098f\\u0995\\u09a4\\u09cd\\u09b0\\u09bf\\u09a4 \\u0995\\u09b0\\u09c1\\u09a8\\u0964 \\u099c\\u09a8\\u09aa\\u09cd\\u09b0\\u09bf\\u09af\\u09bc \\u0987\\u0995\\u09ae\\u09be\\u09b0\\u09cd\\u09b8 \\u0987\\u099e\\u09cd\\u099c\\u09bf\\u09a8\\u09c7\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u0987\\u09a8\\u09cd\\u099f\\u09bf\\u0997\\u09cd\\u09b0\\u09c7\\u09b6\\u09a8 \\u09ae\\u09a1\\u09bf\\u0989\\u09b2 (\\u09b6\\u09c0\\u0998\\u09cd\\u09b0\\u0987 \\u0986\\u09b8\\u099b\\u09c7)\\u0964\",\"ru\":\"\\u041e\\u0442\\u043b\\u0438\\u0447\\u043d\\u043e \\u0434\\u043e\\u043a\\u0443\\u043c\\u0435\\u043d\\u0442\\u0438\\u0440\\u043e\\u0432\\u0430\\u043d\\u043d\\u044b\\u0439 \\u0443\\u0440\\u043e\\u0432\\u0435\\u043d\\u044c API \\u0438 \\u0443\\u0434\\u043e\\u0431\\u043d\\u044b\\u0439 \\u0438\\u043d\\u0442\\u0435\\u0440\\u0444\\u0435\\u0439\\u0441 \\u0434\\u043b\\u044f \\u043b\\u044e\\u0434\\u0435\\u0439. \\u041f\\u0440\\u043e\\u0433\\u0440\\u0430\\u043c\\u043c\\u043d\\u043e\\u0435 \\u043e\\u0431\\u0435\\u0441\\u043f\\u0435\\u0447\\u0435\\u043d\\u0438\\u0435 \\u0434\\u043b\\u044f \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0438 \\u043b\\u0435\\u0433\\u043a\\u043e \\u0438\\u0441\\u043f\\u043e\\u043b\\u044c\\u0437\\u043e\\u0432\\u0430\\u0442\\u044c \\u0432\\u0435\\u0437\\u0434\\u0435: \\u0432\\u0430\\u043c \\u043d\\u0435 \\u043d\\u0443\\u0436\\u043d\\u043e \\u043d\\u0438\\u0447\\u0435\\u0433\\u043e \\u0441\\u043a\\u0430\\u0447\\u0438\\u0432\\u0430\\u0442\\u044c \\u0438\\u043b\\u0438 \\u0443\\u0441\\u0442\\u0430\\u043d\\u0430\\u0432\\u043b\\u0438\\u0432\\u0430\\u0442\\u044c. \\u041f\\u0440\\u043e\\u0441\\u0442\\u0430\\u044f \\u0438\\u043d\\u0442\\u0435\\u0433\\u0440\\u0430\\u0446\\u0438\\u044f \\u0441 \\u043d\\u0430\\u0448\\u0435\\u0439 \\u043f\\u043b\\u0430\\u0442\\u0435\\u0436\\u043d\\u043e\\u0439 \\u0441\\u0438\\u0441\\u0442\\u0435\\u043c\\u043e\\u0439. \\u041c\\u043e\\u0434\\u0443\\u043b\\u0438 \\u0438\\u043d\\u0442\\u0435\\u0433\\u0440\\u0430\\u0446\\u0438\\u0438 \\u0434\\u043b\\u044f \\u043f\\u043e\\u043f\\u0443\\u043b\\u044f\\u0440\\u043d\\u044b\\u0445 \\u0434\\u0432\\u0438\\u0436\\u043a\\u043e\\u0432 \\u044d\\u043b\\u0435\\u043a\\u0442\\u0440\\u043e\\u043d\\u043d\\u043e\\u0439 \\u043a\\u043e\\u043c\\u043c\\u0435\\u0440\\u0446\\u0438\\u0438 (\\u0441\\u043a\\u043e\\u0440\\u043e).\",\"es\":\"Capa API perfectamente documentada e interfaz elegante para humanos. El software de env\\u00edo es f\\u00e1cil de usar en todas partes: no necesita descargar ni instalar nada. Integre f\\u00e1cilmente con nuestro sistema de pago. M\\u00f3dulos de integraci\\u00f3n para motores de comercio electr\\u00f3nico populares (pr\\u00f3ximamente).\",\"zh\":\"\\u5b8c\\u7f8e\\u8bb0\\u5f55\\u7684 API \\u5c42\\u548c\\u6d41\\u7545\\u7684\\u4eba\\u7c7b\\u754c\\u9762\\u3002 \\u8fd0\\u8f93\\u8f6f\\u4ef6\\u5728\\u4efb\\u4f55\\u5730\\u65b9\\u90fd\\u6613\\u4e8e\\u4f7f\\u7528\\uff1a\\u60a8\\u65e0\\u9700\\u4e0b\\u8f7d\\u6216\\u5b89\\u88c5\\u4efb\\u4f55\\u5185\\u5bb9\\u3002 \\u8f7b\\u677e\\u4e0e\\u6211\\u4eec\\u7684\\u652f\\u4ed8\\u7cfb\\u7edf\\u96c6\\u6210\\u3002 \\u6d41\\u884c\\u7535\\u5b50\\u5546\\u52a1\\u5f15\\u64ce\\u7684\\u96c6\\u6210\\u6a21\\u5757\\uff08\\u5373\\u5c06\\u63a8\\u51fa\\uff09\\u3002\"},\"section_button\":{\"en\":\"Technical documentation\",\"ger\":\"Technische Dokumentation\",\"fr\":\"Documentation technique\",\"tr\":\"Teknik d\\u00f6k\\u00fcman\",\"pt\":\"Documenta\\u00e7\\u00e3o t\\u00e9cnica\",\"ar\":\"\\u0627\\u0644\\u062a\\u0648\\u062b\\u064a\\u0642 \\u0627\\u0644\\u0641\\u0646\\u064a\",\"bn\":\"\\u09aa\\u09cd\\u09b0\\u09af\\u09c1\\u0995\\u09cd\\u09a4\\u09bf\\u0997\\u09a4 \\u09a8\\u09a5\\u09bf\\u09aa\\u09a4\\u09cd\\u09b0\\u09c7\",\"ru\":\"\\u0422\\u0435\\u0445\\u043d\\u0438\\u0447\\u0435\\u0441\\u043a\\u0430\\u044f \\u0434\\u043e\\u043a\\u0443\\u043c\\u0435\\u043d\\u0442\\u0430\\u0446\\u0438\\u044f\",\"es\":\"Documentaci\\u00f3n t\\u00e9cnica\",\"zh\":\"\\u6280\\u672f\\u6587\\u6863\"},\"section_button1\":{\"en\":\"Get E-commerce Extension\",\"ger\":\"Holen Sie sich die E-Commerce-Erweiterung\",\"fr\":\"Obtenez l\'extension de commerce \\u00e9lectronique\",\"tr\":\"E-ticaret Uzant\\u0131s\\u0131 Al\\u0131n\",\"pt\":\"Obter extens\\u00e3o de com\\u00e9rcio eletr\\u00f4nico\",\"ar\":\"\\u0627\\u0644\\u062a\\u0648\\u062b\\u064a\\u0642 \\u0627\\u0644\\u0641\\u0646\\u064a\",\"bn\":\"\\u0987-\\u0995\\u09ae\\u09be\\u09b0\\u09cd\\u09b8 \\u098f\\u0995\\u09cd\\u09b8\\u099f\\u09c7\\u09a8\\u09b6\\u09a8 \\u09aa\\u09be\\u09a8\",\"ru\":\"\\u041f\\u043e\\u043b\\u0443\\u0447\\u0438\\u0442\\u044c \\u0440\\u0430\\u0441\\u0448\\u0438\\u0440\\u0435\\u043d\\u0438\\u0435 \\u044d\\u043b\\u0435\\u043a\\u0442\\u0440\\u043e\\u043d\\u043d\\u043e\\u0439 \\u043a\\u043e\\u043c\\u043c\\u0435\\u0440\\u0446\\u0438\\u0438\",\"es\":\"Obtener extensi\\u00f3n de comercio electr\\u00f3nico\",\"zh\":\"\\u83b7\\u53d6\\u7535\\u5b50\\u5546\\u52a1\\u6269\\u5c55\"},\"link1\":{\"type\":\"custom\",\"custom\":\"#\"},\"link2\":{\"type\":\"c