(1, '{\"display\":true,\"testimonials_count\":\"3\",\"header_bg\":null,\"title_color\":null,\"pathColor\":null,\"rating_cont1\":\"5\",\"rating_cont2\":\"3\",\"rating_cont3\":\"4\",\"section_description\":{\"en\":\"Using Cargo? Please give us your feedback.\",\"ger\":\"Fracht verwenden? Bitte geben Sie uns Ihr Feedback.\",\"fr\":\"Vous utilisez Cargo\\u00a0? Veuillez nous faire part de vos commentaires.\",\"tr\":\"Kargo Kullan\\u0131yor musunuz? L\\u00fctfen bize geri bildirimde bulunun.\",\"pt\":\"Usando Carga? Por favor, d\\u00ea-nos a sua opini\\u00e3o.\",\"ar\":\"\\u0647\\u0644 \\u062a\\u0633\\u062a\\u062e\\u062f\\u0645  \\u0643\\u0627\\u0631\\u062c\\u0648 \\u061f \\u064a\\u0631\\u062c\\u0649 \\u062a\\u0639\\u0637\\u064a\\u0646\\u0627 \\u0631\\u062f\\u0648\\u062f \\u0641\\u0639\\u0644 \\u0628\\u0643.\",\"bn\":\"\\u0995\\u09be\\u09b0\\u09cd\\u0997\\u09cb \\u09ac\\u09cd\\u09af\\u09ac\\u09b9\\u09be\\u09b0 \\u0995\\u09b0\\u099b\\u09c7\\u09a8? \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09ae\\u09a4\\u09be\\u09ae\\u09a4 \\u09a6\\u09bf\\u09a8 \\u09a6\\u09af\\u09bc\\u09be \\u0995\\u09b0\\u09c7\\u0964\",\"ru\":\"\\u0418\\u0441\\u043f\\u043e\\u043b\\u044c\\u0437\\u043e\\u0432\\u0430\\u043d\\u0438\\u0435 \\u0433\\u0440\\u0443\\u0437\\u0430? \\u041f\\u043e\\u0436\\u0430\\u043b\\u0443\\u0439\\u0441\\u0442\\u0430, \\u0434\\u0430\\u0439\\u0442\\u0435 \\u043d\\u0430\\u043c \\u0441\\u0432\\u043e\\u0439 \\u043e\\u0442\\u0437\\u044b\\u0432.\",\"es\":\"\\u00bfUsando Carga? Por favor danos tu opini\\u00f3n.\",\"zh\":\"\\u4f7f\\u7528\\u8d27\\u7269\\uff1f \\u8bf7\\u7ed9\\u6211\\u4eec\\u60a8\\u7684\\u53cd\\u9988\\u610f\\u89c1\\u3002\"},\"section_description1\":{\"en\":\"Dmitriy, Samara, Russia \\/ 17 Jan 2022 I sell my product on Amazon. They have their own logistics, but I prefer to buy postal labels on Qwintry Global. Firstly, I am satisfied with the prices, and they are very attractive. Secondly, there is support in Russian and English. Since I am from Russia, it is more convenient and understandable for me to get consulting in my native language. For me, this business is completely new, but thanks to a proper and simple interface, I generate postal labels quite quickly. Keep up the good work guys, thank you.\",\"ger\":\"Dmitriy, Samara, Russland \\/ 17. Januar 2022 Ich verkaufe mein Produkt bei Amazon. Sie haben ihre eigene Logistik, aber ich bevorzuge es, Postetiketten bei Qwintry Global zu kaufen. Erstens bin ich mit den Preisen zufrieden, und sie sind sehr attraktiv. Zweitens gibt es Unterst\\u00fctzung in Russisch und Englisch. Da ich aus Russland komme, ist es f\\u00fcr mich bequemer und verst\\u00e4ndlicher, mich in meiner Muttersprache beraten zu lassen. F\\u00fcr mich ist dieses Gesch\\u00e4ft v\\u00f6llig neu, aber dank einer ordentlichen und einfachen Oberfl\\u00e4che erstelle ich Postetiketten recht schnell. Macht weiter so Jungs, danke.\",\"fr\":\"Dmitriy, Samara, Russie \\/ 17 janvier 2022 Je vends mon produit sur Amazon. Ils ont leur propre logistique, mais je pr\\u00e9f\\u00e8re acheter des \\u00e9tiquettes postales sur Qwintry Global. Tout d\'abord, je suis satisfait des prix, et ils sont tr\\u00e8s attractifs. Deuxi\\u00e8mement, il y a un support en russe et en anglais. Comme je viens de Russie, il est plus pratique et compr\\u00e9hensible pour moi d\'obtenir des conseils dans ma langue maternelle. Pour moi, ce m\\u00e9tier est totalement nouveau, mais gr\\u00e2ce \\u00e0 une interface correcte et simple, je g\\u00e9n\\u00e8re assez rapidement des \\u00e9tiquettes postales. Continuez votre bon travail les gars, merci.\",\"tr\":\"Dmitriy, Samara, Rusya \\/ 17 Ocak 2022 \\u00dcr\\u00fcn\\u00fcm\\u00fc Amazon\'da sat\\u0131yorum. Kendi lojistikleri var ama ben Qwintry Global\'den posta etiketleri sat\\u0131n almay\\u0131 tercih ediyorum. \\u0130lk olarak, fiyatlardan memnunum ve \\u00e7ok cazipler. \\u0130kincisi, Rus\\u00e7a ve \\u0130ngilizce olarak destek var. Rusya\'dan geldi\\u011fim i\\u00e7in ana dilimde dan\\u0131\\u015fmanl\\u0131k almak benim i\\u00e7in daha uygun ve anla\\u015f\\u0131l\\u0131r. Benim i\\u00e7in bu i\\u015f tamamen yeni ama d\\u00fczg\\u00fcn ve basit bir aray\\u00fcz sayesinde olduk\\u00e7a h\\u0131zl\\u0131 bir \\u015fekilde posta etiketleri olu\\u015fturuyorum. \\u0130yi \\u00e7al\\u0131\\u015fmaya devam edin \\u00e7ocuklar, te\\u015fekk\\u00fcrler.\",\"pt\":\"Dmitriy, Samara, R\\u00fassia \\/ 17 de janeiro de 2022 Vendo meu produto na Amazon. Eles t\\u00eam sua pr\\u00f3pria log\\u00edstica, mas eu prefiro comprar etiquetas postais na Qwintry Global. Em primeiro lugar, estou satisfeito com os pre\\u00e7os, e eles s\\u00e3o muito atraentes. Em segundo lugar, h\\u00e1 suporte em russo e ingl\\u00eas. Como sou da R\\u00fassia, \\u00e9 mais conveniente e compreens\\u00edvel para mim obter consultoria em minha l\\u00edngua nativa. Para mim, este neg\\u00f3cio \\u00e9 completamente novo, mas gra\\u00e7as a uma interface adequada e simples, gero etiquetas postais com bastante rapidez. Continuem com o bom trabalho rapazes, obrigado.\",\"ar\":\"\\u062f\\u064a\\u0645\\u062a\\u0631\\u064a \\u060c \\u0633\\u0627\\u0645\\u0627\\u0631\\u0627 \\u060c \\u0631\\u0648\\u0633\\u064a\\u0627 \\/ 17 \\u0643\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u062b\\u0627\\u0646\\u064a (\\u064a\\u0646\\u0627\\u064a\\u0631) 2022 \\u0623\\u0628\\u064a\\u0639 \\u0645\\u0646\\u062a\\u062c\\u064a \\u0639\\u0644\\u0649 \\u0623\\u0645\\u0627\\u0632\\u0648\\u0646. \\u0644\\u062f\\u064a\\u0647\\u0645 \\u0644\\u0648\\u062c\\u0633\\u062a\\u064a\\u0627\\u062a\\u0647\\u0645 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u060c \\u0644\\u0643\\u0646\\u0646\\u064a \\u0623\\u0641\\u0636\\u0644 \\u0634\\u0631\\u0627\\u0621 \\u0645\\u0644\\u0635\\u0642\\u0627\\u062a \\u0628\\u0631\\u064a\\u062f\\u064a\\u0629 \\u0639\\u0644\\u0649 Qwintry Global. \\u0627\\u0648\\u0644\\u0627 \\u0627\\u0646\\u0627 \\u0631\\u0627\\u0636 \\u0639\\u0646 \\u0627\\u0644\\u0627\\u0633\\u0639\\u0627\\u0631 \\u0648\\u0647\\u064a \\u0645\\u063a\\u0631\\u064a\\u0629 \\u062c\\u062f\\u0627. \\u062b\\u0627\\u0646\\u064a\\u064b\\u0627 \\u060c \\u0647\\u0646\\u0627\\u0643 \\u062f\\u0639\\u0645 \\u0628\\u0627\\u0644\\u0644\\u063a\\u062a\\u064a\\u0646 \\u0627\\u0644\\u0631\\u0648\\u0633\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0625\\u0646\\u062c\\u0644\\u064a\\u0632\\u064a\\u0629. \\u0628\\u0645\\u0627 \\u0623\\u0646\\u0646\\u064a \\u0645\\u0646 \\u0631\\u0648\\u0633\\u064a\\u0627 \\u060c \\u0641\\u0645\\u0646 \\u0627\\u0644\\u0623\\u0633\\u0647\\u0644 \\u0628\\u0627\\u0644\\u0646\\u0633\\u0628\\u0629 \\u0644\\u064a \\u0623\\u0646 \\u0623\\u062d\\u0635\\u0644 \\u0639\\u0644\\u0649 \\u0627\\u0633\\u062a\\u0634\\u0627\\u0631\\u0629 \\u0628\\u0644\\u063a\\u062a\\u064a \\u0627\\u0644\\u0623\\u0645. \\u0628\\u0627\\u0644\\u0646\\u0633\\u0628\\u0629 \\u0644\\u064a \\u060c \\u0647\\u0630\\u0627 \\u0627\\u0644\\u0639\\u0645\\u0644 \\u062c\\u062f\\u064a\\u062f \\u062a\\u0645\\u0627\\u0645\\u064b\\u0627 \\u060c \\u0648\\u0644\\u0643\\u0646 \\u0628\\u0641\\u0636\\u0644 \\u0627\\u0644\\u0648\\u0627\\u062c\\u0647\\u0629 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628\\u0629 \\u0648\\u0627\\u0644\\u0628\\u0633\\u064a\\u0637\\u0629 \\u060c \\u0623\\u0642\\u0648\\u0645 \\u0628\\u0625\\u0646\\u0634\\u0627\\u0621 \\u0645\\u0644\\u0635\\u0642\\u0627\\u062a \\u0628\\u0631\\u064a\\u062f\\u064a\\u0629 \\u0628\\u0633\\u0631\\u0639\\u0629 \\u0643\\u0628\\u064a\\u0631\\u0629. \\u0627\\u0633\\u062a\\u0645\\u0631\\u0648\\u0627 \\u0641\\u064a \\u0627\\u0644\\u0639\\u0645\\u0644 \\u0627\\u0644\\u062c\\u064a\\u062f \\u064a\\u0627 \\u0631\\u0641\\u0627\\u0642 \\u060c \\u0634\\u0643\\u0631\\u0627 \\u0644\\u0643\\u0645.\",\"bn\":\"\\u09a6\\u09bf\\u09ae\\u09bf\\u09a4\\u09cd\\u09b0\\u09bf, \\u09b8\\u09be\\u09ae\\u09be\\u09b0\\u09be, \\u09b0\\u09be\\u09b6\\u09bf\\u09af\\u09bc\\u09be \\/ 17 \\u099c\\u09be\\u09a8\\u09c1\\u09af\\u09bc\\u09be\\u09b0\\u09c0 2022 \\u0986\\u09ae\\u09bf \\u0986\\u09ae\\u09be\\u09