b\\u0445, \\u0435\\u0441\\u0442\\u044c \\u043f\\u043e\\u0434\\u0434\\u0435\\u0440\\u0436\\u043a\\u0430 \\u043d\\u0430 \\u0440\\u0443\\u0441\\u0441\\u043a\\u043e\\u043c \\u0438 \\u0430\\u043d\\u0433\\u043b\\u0438\\u0439\\u0441\\u043a\\u043e\\u043c \\u044f\\u0437\\u044b\\u043a\\u0430\\u0445. \\u041f\\u043e\\u0441\\u043a\\u043e\\u043b\\u044c\\u043a\\u0443 \\u044f \\u0438\\u0437 \\u0420\\u043e\\u0441\\u0441\\u0438\\u0438, \\u043c\\u043d\\u0435 \\u0443\\u0434\\u043e\\u0431\\u043d\\u0435\\u0435 \\u0438 \\u043f\\u043e\\u043d\\u044f\\u0442\\u043d\\u0435\\u0435 \\u043f\\u043e\\u043b\\u0443\\u0447\\u0438\\u0442\\u044c \\u043a\\u043e\\u043d\\u0441\\u0443\\u043b\\u044c\\u0442\\u0430\\u0446\\u0438\\u044e \\u043d\\u0430 \\u0440\\u043e\\u0434\\u043d\\u043e\\u043c \\u044f\\u0437\\u044b\\u043a\\u0435. \\u0414\\u043b\\u044f \\u043c\\u0435\\u043d\\u044f \\u044d\\u0442\\u043e \\u0434\\u0435\\u043b\\u043e \\u0441\\u043e\\u0432\\u0435\\u0440\\u0448\\u0435\\u043d\\u043d\\u043e \\u043d\\u043e\\u0432\\u043e\\u0435, \\u043d\\u043e \\u0431\\u043b\\u0430\\u0433\\u043e\\u0434\\u0430\\u0440\\u044f \\u043f\\u0440\\u0430\\u0432\\u0438\\u043b\\u044c\\u043d\\u043e\\u043c\\u0443 \\u0438 \\u043f\\u0440\\u043e\\u0441\\u0442\\u043e\\u043c\\u0443 \\u0438\\u043d\\u0442\\u0435\\u0440\\u0444\\u0435\\u0439\\u0441\\u0443 \\u044f \\u0434\\u043e\\u0432\\u043e\\u043b\\u044c\\u043d\\u043e \\u0431\\u044b\\u0441\\u0442\\u0440\\u043e \\u0433\\u0435\\u043d\\u0435\\u0440\\u0438\\u0440\\u0443\\u044e \\u043f\\u043e\\u0447\\u0442\\u043e\\u0432\\u044b\\u0435 \\u044f\\u0440\\u043b\\u044b\\u043a\\u0438. \\u041f\\u0440\\u043e\\u0434\\u043e\\u043b\\u0436\\u0430\\u0439\\u0442\\u0435 \\u0432 \\u0442\\u043e\\u043c \\u0436\\u0435 \\u0434\\u0443\\u0445\\u0435, \\u0440\\u0435\\u0431\\u044f\\u0442\\u0430, \\u0441\\u043f\\u0430\\u0441\\u0438\\u0431\\u043e.\",\"es\":\"Dmitriy, Samara, Rusia \\/ 17 de enero de 2022 Vendo mi producto en Amazon. Tienen su propia log\\u00edstica, pero prefiero comprar etiquetas postales en Qwintry Global. En primer lugar, estoy satisfecho con los precios y son muy atractivos. En segundo lugar, hay soporte en ruso e ingl\\u00e9s. Dado que soy de Rusia, es m\\u00e1s conveniente y comprensible para m\\u00ed recibir consultas en mi idioma nativo. Para m\\u00ed, este negocio es completamente nuevo, pero gracias a una interfaz adecuada y simple, genero etiquetas postales con bastante rapidez. Sigan con el buen trabajo chicos, gracias.\",\"zh\":\"Dmitriy\\uff0c\\u4fc4\\u7f57\\u65af\\u8428\\u9a6c\\u62c9 \\/ 2022 \\u5e74 1 \\u6708 17 \\u65e5\\u6211\\u5728\\u4e9a\\u9a6c\\u900a\\u4e0a\\u9500\\u552e\\u6211\\u7684\\u4ea7\\u54c1\\u3002 \\u4ed6\\u4eec\\u6709\\u81ea\\u5df1\\u7684\\u7269\\u6d41\\uff0c\\u4f46\\u6211\\u66f4\\u559c\\u6b22\\u5728 Qwintry Global \\u4e0a\\u8d2d\\u4e70\\u90ae\\u653f\\u6807\\u7b7e\\u3002 \\u9996\\u5148\\uff0c\\u6211\\u5bf9\\u4ef7\\u683c\\u5f88\\u6ee1\\u610f\\uff0c\\u800c\\u4e14\\u975e\\u5e38\\u6709\\u5438\\u5f15\\u529b\\u3002 \\u5176\\u6b21\\uff0c\\u652f\\u6301\\u4fc4\\u8bed\\u548c\\u82f1\\u8bed\\u3002 \\u56e0\\u4e3a\\u6211\\u6765\\u81ea\\u4fc4\\u7f57\\u65af\\uff0c\\u6240\\u4ee5\\u7528\\u6211\\u7684\\u6bcd\\u8bed\\u8fdb\\u884c\\u54a8\\u8be2\\u5bf9\\u6211\\u6765\\u8bf4\\u66f4\\u65b9\\u4fbf\\u3001\\u66f4\\u5bb9\\u6613\\u7406\\u89e3\\u3002 \\u5bf9\\u6211\\u6765\\u8bf4\\uff0c\\u8fd9\\u9879\\u4e1a\\u52a1\\u662f\\u5168\\u65b0\\u7684\\uff0c\\u4f46\\u7531\\u4e8e\\u754c\\u9762\\u7b80\\u6d01\\uff0c\\u6211\\u53ef\\u4ee5\\u5f88\\u5feb\\u751f\\u6210\\u90ae\\u653f\\u6807\\u7b7e\\u3002 \\u7ee7\\u7eed\\u52aa\\u529b\\uff0c\\u4f19\\u8ba1\\u4eec\\uff0c\\u8c22\\u8c22\\u3002\"},\"path1\":{\"en\":\"Dmitriy, Samara, Russia \\/ 17 Jan 2022\",\"ger\":\"Dmitriy, Samara, Russland \\/ 17. Januar 2022\",\"fr\":\"Dmitriy, Samara, Russie \\/ 17 janvier 2022\",\"tr\":\"Dmitriy, Samara, Rusya \\/ 17 Ocak 2022\",\"pt\":\"Dmitriy, Samara, R\\u00fassia \\/ 17 de janeiro de 2022\",\"ar\":\"\\u062f\\u0645\\u064a\\u062a\\u0631\\u064a \\u060c \\u0633\\u0627\\u0645\\u0627\\u0631\\u0627 \\u060c \\u0631\\u0648\\u0633\\u064a\\u0627 \\/ 17 \\u0643\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u062b\\u0627\\u0646\\u064a (\\u064a\\u0646\\u0627\\u064a\\u0631) 2022\",\"bn\":\"\\u09a6\\u09bf\\u09ae\\u09bf\\u09a4\\u09cd\\u09b0\\u09bf, \\u09b8\\u09be\\u09ae\\u09be\\u09b0\\u09be, \\u09b0\\u09be\\u09b6\\u09bf\\u09af\\u09bc\\u09be \\/ 17 \\u099c\\u09be\\u09a8\\u09c1\\u09af\\u09bc\\u09be\\u09b0\\u09c0 2022\",\"ru\":\"\\u0414\\u043c\\u0438\\u0442\\u0440\\u0438\\u0439, \\u0421\\u0430\\u043c\\u0430\\u0440\\u0430, \\u0420\\u043e\\u0441\\u0441\\u0438\\u044f \\/ 17 \\u044f\\u043d\\u0432\\u0430\\u0440\\u044f 2022 \\u0433.\",\"es\":\"Dmitriy, Samara, Rusia \\/ 17 de enero de 2022\",\"zh\":\"\\u4fc4\\u7f57\\u65af\\u8428\\u9a6c\\u62c9\\u5fb7\\u7c73\\u7279\\u91cc \\/ 2022 \\u5e74 1 \\u6708 17 \\u65e5\"},\"section_description2\":{\"en\":\"Dmitriy, Samara, Russia \\/ 17 Jan 2022 I sell my product on Amazon. They have their own logistics, but I prefer to buy postal labels on Qwintry Global. Firstly, I am satisfied with the prices, and they are very attractive. Secondly, there is support in Russian and English. Since I am from Russia, it is more convenient and understandable for me to get consulting in my native language. For me, this business is completely new, but thanks to a proper and simple interface, I generate postal labels quite quickly. Keep up the good work guys, thank you.\",\"ger\":\"Dmitriy, Samara, Russland \\/ 17. Januar 2022 Ich verkaufe mein Produkt bei Amazon. Sie haben ihre eigene Logistik, aber ich bevorzuge es, Postetiketten bei Qwintry Global zu kaufen. Erstens bin ich mit den Preisen zufrieden, und sie sind sehr attraktiv. Zweitens gibt es Unterst\\u00fctzung in Russisch und Englisch. Da ich aus Russland komme, ist es f\\u00fcr mich bequemer und verst\\u00e4ndlicher, mich in meiner Muttersprache beraten zu lassen. F\\u00fcr mich ist dieses Gesch\\u00e4ft v\\u00f6llig neu, aber dank einer ordentlichen und einfachen Oberfl\\u00e4che erstelle ich Postetiketten recht schnell. Macht weiter so Jungs, danke.\",\"fr\":\"Dmitriy, Samara, Russie \\/ 17 janvier 2022 Je vends mon produit sur Amazon. Ils ont leur propre logistique, mais je pr\\u00e9f\\u00e8re acheter des \\u00e9tiquettes postales sur Qwintry Global. Tout d\'abord, je suis satisfait des prix, et ils sont tr\\u00e8s attractifs. Deuxi\\u00e8mement, il y a un support en russe et en anglais. Comme je viens de Russie, il est plus pratique et compr\\u00e9hensible pour moi d\'obtenir des conseils dans ma langue maternelle. Pour moi, ce m\\u00e9tier est totalement nouveau, mais gr\\u00e2ce \\u00e0 une interface correcte et simple, je g\\u00e9n\\u00e8re assez rapidement des \\u00e9tiquettes postales. Continuez votre bon travail les gars, merci.\",\"tr\":\"Dmitriy, Samara, Rusya \\/ 17 Ocak 2022 \\u00dcr\\u00fcn\\u00fcm\\u00fc Amazon\'da sat\\u0131yorum. Kendi lojistikleri var ama ben Qwintry Global\'den posta etiketleri sat\\u0131n almay\\u0131 tercih ediyorum. \\u0130lk olarak, fiyatlardan memnunum ve \\u00e7ok cazipler. \\u0130kincisi, Rus\\u00e7a ve \\u0130ngilizce olarak destek var. Rusya\'dan geldi\\u011fim i\\u00e7in ana dilimde dan\\u0131\\u015fmanl\\u0131k almak benim i\\u00e7in daha uygun ve anla\\u015f\\u0131l\\u0131r. Benim i\\u00e7in bu i\\u015f tamamen yeni ama d\\u00fczg\\u00fcn ve basit bir aray\\u00fcz sayesinde olduk\\u00e7a h\\u0131zl\\u0131 bir \\u015fekilde posta etiketleri olu\\u015fturuyorum. \\u0130yi \\u00e7al\\u0131\\u015fmaya devam edin \\u00e7ocuklar, te\\u015fekk\\u00fcrler.\",\"pt\":\"Dmitriy, Samara, R\\u00fassia \\/ 17 de janeiro de 2022 Vendo meu produto na Amazon. Eles t\\u00eam sua pr\\u00f3pria log\\u00edstica, mas eu prefiro comprar etiquetas postais na Qwintry Global. Em primeiro lugar, estou satisfeito com os pre\\u00e7os, e eles s\\u00e3o muito atraentes. Em segundo lugar, h\\u00e1 suporte em russo e ingl\\u00eas. Como sou da R\\u00fassia, \\u00e9 mais conveniente e compreens\\u00edvel para mim obter consultoria em minha l\\u00edngua nativa. Para mim, este neg\\u00f3cio \\u00e9 completamente novo, mas gra\\u00e7as a uma interface adequada e simples, gero etiquetas postais com bastante rapidez. Continuem com o bom trabalho rapazes, obrigado.\",\"ar\":\"\\u062f\\u064a\\u0645\\u062a\\u0631\\u064a \\u060c \\u0633\\u0627\\u0645\\u0627\\u0631\\u0627 \\u060c \\u0631\\u0648\\u0633\\u064a\\u0627 \\/ 17 \\u0643\\u0627\\u0646\\u0648\\u0646 \\u0627\\u0644\\u062b\\u0627\\u0646\\u064a (\\u064a\\u0646\\u0627\\u064a\\u0631) 2022 \\u0623\\u0628\\u064a\\u0639 \\u0645\\u0646\\u062a\\u062c\\u064a \\u0639\\u0644\\u0649 \\u0623\\u0645\\u0627\\u0632\\u0648\\u0646. \\u0644\\u062f\\u064a\\u0647\\u0645 \\u0644\\u0648\\u062c\\u0633\\u062a\\u064a\\u0627\\u062a\\u0647\\u0645 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u060c \\u0644\\u0643\\u0646\\u0646\\u064a \\u0623\\u0641\\u0636\\u0644 \\u0634\\u0631\\u0627\\u0621 \\u0645\\u0644\\u0635\\u0642\\u0627\\u062a \\u0628\\u0631\\u064a\\u062f\\u064a\\u0629 \\u0639\\u0644\\u0649 Qwintry Global. \\u0627\\u0648\\u0644\\u0627 \\u0627\\u0646\\u0627 \\u0631\\u0627\\u0636 \\u0639\\u0646 \\u0627\\u0644\\u0627\\u0633\\u0639\\u0627\\u0631 \\u0648\\u0647\\u064a \\u0645\\u063a\\u0631\\u064a\\u0629 \\u062c\\u062f\\u0627. \\u062b\\u0627\\u0646\\u064a\\u064b\\u0627 \\u060c \\u0647\\u0646\\u0627\\u0643 \\u062f\\u0639\\u0645 \\u0628\\u0627\\u0644\\u0644\\u063a\\u062a\\u064a\\u0646 \\u0627\\u0644\\u0631\\u0648\\u0633\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0625\\u0646\\u062c\\u0644\\u064a\\u0632\\u064a\\u0629. \\u0628\\u0645\\u0627 \\u0623\\u0646\\u0646\\u064a \\u0645\\u0646 \\u0631\\u0648\\u0633\\u064a\\u0627 \\u060c \\u0641\\u0645\\u0646 \\u0627\\u0644\\u0623\\u0633\\u0647\\u0644 \\u0628\\u0627\\u0644\\u0646\\u0633\\u0628\\u0629 \\u0644\\u064a \\u0623\\u0646 \\u0623\\u062d\\u0635\\u0644 \\u0639\\u0644\\u0649 \\u0627\\u0633\\u062a\\u0634\\u0627\\u0631\\u0629 \\u0628\\u0644\\u063a\\u062a\\u064a \\u0627\\u0644\\u0623\\u0645. \\u0628\\u0627\\u0644\\u0646\\u0633\\u0628\\u0629 \\u0644\\u064a \\u060c \\u0647\\u063