(1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"link_color\":null,\"text_color\":null,\"section_title\":{\"en\":\"Contact Us\",\"ger\":\"Kontaktiere uns\",\"fr\":\"Nous contacter\",\"tr\":\"Bize Ula\\u015f\\u0131n\",\"pt\":\"Contate-nos\",\"ar\":\"\\u0627\\u062a\\u0635\\u0644 \\u0628\\u0646\\u0627\",\"bn\":\"\\u09af\\u09cb\\u0997\\u09be\\u09af\\u09cb\\u0997 \\u0995\\u09b0\\u09c1\\u09a8\",\"ru\":\"\\u0421\\u0432\\u044f\\u0436\\u0438\\u0442\\u0435\\u0441\\u044c \\u0441 \\u043d\\u0430\\u043c\\u0438\",\"es\":\"Contacta con nosotros\",\"zh\":\"\\u8054\\u7cfb\\u6211\\u4eec\"},\"section_title1\":{\"en\":\"About Us\",\"ger\":\"\\u00dcber uns\",\"fr\":\"\\u00c0 propos de nous\",\"tr\":\"Hakk\\u0131m\\u0131zda\",\"pt\":\"Sobre n\\u00f3s\",\"ar\":\"\\u0645\\u0639\\u0644\\u0648\\u0645\\u0627\\u062a \\u0639\\u0646\\u0627\",\"bn\":\"\\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b8\\u09ae\\u09cd\\u09aa\\u09b0\\u09cd\\u0995\\u09c7\",\"ru\":\"\\u041e \\u043d\\u0430\\u0441\",\"es\":\"Sobre nosotras\",\"zh\":\"\\u5173\\u4e8e\\u6211\\u4eec\"},\"section_description\":{\"en\":\"If you are looking for more information, or have a question, contact us so we can give you a helping hand.\",\"ger\":\"Wenn Sie weitere Informationen suchen oder eine Frage haben, kontaktieren Sie uns, damit wir Ihnen helfen k\\u00f6nnen.\",\"fr\":\"Si vous cherchez plus d\'informations ou avez une question, contactez-nous afin que nous puissions vous donner un coup de main.\",\"tr\":\"Daha fazla bilgi ar\\u0131yorsan\\u0131z veya bir sorunuz varsa, size yard\\u0131m edebilmemiz i\\u00e7in bizimle ileti\\u015fime ge\\u00e7in.\",\"pt\":\"Se voc\\u00ea estiver procurando mais informa\\u00e7\\u00f5es ou tiver alguma d\\u00favida, entre em contato conosco para que possamos ajud\\u00e1-lo.\",\"ar\":\"\\u0625\\u0630\\u0627 \\u0643\\u0646\\u062a \\u062a\\u0628\\u062d\\u062b \\u0639\\u0646 \\u0645\\u0632\\u064a\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0639\\u0644\\u0648\\u0645\\u0627\\u062a \\u060c \\u0623\\u0648 \\u0644\\u062f\\u064a\\u0643 \\u0633\\u0624\\u0627\\u0644 \\u060c \\u0641\\u0627\\u062a\\u0635\\u0644 \\u0628\\u0646\\u0627 \\u062d\\u062a\\u0649 \\u0646\\u062a\\u0645\\u0643\\u0646 \\u0645\\u0646 \\u0645\\u0633\\u0627\\u0639\\u062f\\u062a\\u0643.\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09bf \\u09af\\u09a6\\u09bf \\u0986\\u09b0\\u09cb \\u09a4\\u09a5\\u09cd\\u09af \\u0996\\u09c1\\u0981\\u099c\\u099b\\u09c7\\u09a8, \\u09ac\\u09be \\u098f\\u0995\\u099f\\u09bf \\u09aa\\u09cd\\u09b0\\u09b6\\u09cd\\u09a8 \\u0986\\u099b\\u09c7, \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b8\\u09be\\u09a5\\u09c7 \\u09af\\u09cb\\u0997\\u09be\\u09af\\u09cb\\u0997 \\u0995\\u09b0\\u09c1\\u09a8 \\u09af\\u09be\\u09a4\\u09c7 \\u0986\\u09ae\\u09b0\\u09be \\u0986\\u09aa\\u09a8\\u09be\\u0995\\u09c7 \\u09b8\\u09be\\u09b9\\u09be\\u09af\\u09cd\\u09af\\u09c7\\u09b0 \\u09b9\\u09be\\u09a4 \\u09a6\\u09bf\\u09a4\\u09c7 \\u09aa\\u09be\\u09b0\\u09bf\\u0964\",\"ru\":\"\\u0415\\u0441\\u043b\\u0438 \\u0432\\u0430\\u043c \\u043d\\u0443\\u0436\\u043d\\u0430 \\u0434\\u043e\\u043f\\u043e\\u043b\\u043d\\u0438\\u0442\\u0435\\u043b\\u044c\\u043d\\u0430\\u044f \\u0438\\u043d\\u0444\\u043e\\u0440\\u043c\\u0430\\u0446\\u0438\\u044f \\u0438\\u043b\\u0438 \\u0443 \\u0432\\u0430\\u0441 \\u0435\\u0441\\u0442\\u044c \\u0432\\u043e\\u043f\\u0440\\u043e\\u0441, \\u0441\\u0432\\u044f\\u0436\\u0438\\u0442\\u0435\\u0441\\u044c \\u0441 \\u043d\\u0430\\u043c\\u0438, \\u0447\\u0442\\u043e\\u0431\\u044b \\u043c\\u044b \\u043c\\u043e\\u0433\\u043b\\u0438 \\u043f\\u0440\\u043e\\u0442\\u044f\\u043d\\u0443\\u0442\\u044c \\u0432\\u0430\\u043c \\u0440\\u0443\\u043a\\u0443 \\u043f\\u043e\\u043c\\u043e\\u0449\\u0438.\",\"es\":\"Si buscas m\\u00e1s informaci\\u00f3n, o tienes alguna duda, cont\\u00e1ctanos para que podamos echarte una mano.\",\"zh\":\"\\u5982\\u679c\\u60a8\\u6b63\\u5728\\u5bfb\\u627e\\u66f4\\u591a\\u4fe1\\u606f\\u6216\\u6709\\u4efb\\u4f55\\u7591\\u95ee\\uff0c\\u8bf7\\u8054\\u7cfb\\u6211\\u4eec\\uff0c\\u4ee5\\u4fbf\\u6211\\u4eec\\u4e3a\\u60a8\\u63d0\\u4f9b\\u5e2e\\u52a9\\u3002\"},\"section_description1\":{\"en\":\"Cargo has more than ten years of experience in developing IT-solutions for international logistics.\",\"ger\":\"Cargo verf\\u00fcgt \\u00fcber mehr als zehn Jahre Erfahrung in der Entwicklung von IT-L\\u00f6sungen f\\u00fcr die internationale Logistik.\",\"fr\":\"Qwintry Global a plus de dix ans d\'exp\\u00e9rience dans le d\\u00e9veloppement de solutions informatiques pour la logistique internationale.\",\"tr\":\"Qwintry Global, uluslararas\\u0131 lojistik i\\u00e7in BT \\u00e7\\u00f6z\\u00fcmleri geli\\u015ftirme konusunda on y\\u0131ldan fazla deneyime sahiptir.\",\"pt\":\"A Qwintry Global tem mais de dez anos de experi\\u00eancia no desenvolvimento de solu\\u00e7\\u00f5es de TI para log\\u00edstica internacional.\",\"ar\":\"\\u062a\\u062a\\u0645\\u062a\\u0639  \\u0643\\u0627\\u0631\\u062c\\u0648 \\u0628\\u0623\\u0643\\u062b\\u0631 \\u0645\\u0646 \\u0639\\u0634\\u0631 \\u0633\\u0646\\u0648\\u0627\\u062a \\u0645\\u0646 \\u0627\\u0644\\u062e\\u0628\\u0631\\u0629 \\u0641\\u064a \\u062a\\u0637\\u0648\\u064a\\u0631 \\u062d\\u0644\\u0648\\u0644 \\u062a\\u0643\\u0646\\u0648\\u0644\\u0648\\u062c\\u064a\\u0627 \\u0627\\u0644\\u0645\\u0639\\u0644\\u0648\\u0645\\u0627\\u062a \\u0644\\u0644\\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u0644\\u0648\\u062c\\u0633\\u062a\\u064a\\u0629 \\u0627\\u0644\\u062f\\u0648\\u0644\\u064a\\u0629.\",\"bn\":\"\\u0986\\u09a8\\u09cd\\u09a4\\u09b0\\u09cd\\u099c\\u09be\\u09a4\\u09bf\\u0995 \\u09b8\\u09b0\\u09ac\\u09b0\\u09be\\u09b9\\u09c7\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u0986\\u0987\\u099f\\u09bf-\\u09b8\\u09b2\\u09bf\\u0989\\u09b6\\u09a8 \\u09a4\\u09c8\\u09b0\\u09bf\\u09a4\\u09c7 \\u0995\\u09be\\u09b0\\u09cd\\u0997\\u09cb\\u09b0 \\u09a6\\u09b6 \\u09ac\\u099b\\u09b0\\u09c7\\u09b0\\u0993 \\u09ac\\u09c7\\u09b6\\u09bf \\u0985\\u09ad\\u09bf\\u099c\\u09cd\\u099e\\u09a4\\u09be \\u09b0\\u09af\\u09bc\\u09c7\\u099b\\u09c7\\u0964\",\"ru\":\"Cargo \\u0438\\u043c\\u0435\\u0435\\u0442 \\u0431\\u043e\\u043b\\u0435\\u0435 \\u0447\\u0435\\u043c \\u0434\\u0435\\u0441\\u044f\\u0442\\u0438\\u043b\\u0435\\u0442\\u043d\\u0438\\u0439 \\u043e\\u043f\\u044b\\u0442 \\u0440\\u0430\\u0437\\u0440\\u0430\\u0431\\u043e\\u0442\\u043a\\u0438 IT-\\u0440\\u0435\\u0448\\u0435\\u043d\\u0438\\u0439 \\u0434\\u043b\\u044f \\u043c\\u0435\\u0436\\u0434\\u0443\\u043d\\u0430\\u0440\\u043e\\u0434\\u043d\\u043e\\u0439 \\u043b\\u043e\\u0433\\u0438\\u0441\\u0442\\u0438\\u043a\\u0438.\",\"es\":\"cargo tiene m\\u00e1s de diez a\\u00f1os de experiencia en el desarrollo de soluciones inform\\u00e1ticas para la log\\u00edstica internacional.\",\"zh\":\"cargo \\u5728\\u5f00\\u53d1\\u56fd\\u9645\\u7269\\u6d41 IT \\u89e3\\u51b3\\u65b9\\u6848\\u65b9\\u9762\\u62e5\\u6709\\u5341\\u591a\\u5e74\\u7684\\u7ecf\\u9a8c\\u3002\"},\"link_name1\":{\"en\":\"Learn more\",\"ger\":\"Mehr erfahren\",\"fr\":\"Apprendre encore plus\",\"tr\":\"Daha fazla bilgi edin\",\"pt\":\"Saber mais\",\"ar\":\"\\u062a\\u0639\\u0644\\u0645 \\u0623\\u0643\\u062b\\u0631\",\"bn\":\"\\u0986\\u09b0\\u0993 \\u099c\\u09be\\u09a8\\u09c1\\u09a8\",\"ru\":\"\\u0423\\u0447\\u0438\\u0442\\u044c \\u0431\\u043e\\u043b\\u044c\\u0448\\u0435\",\"es\":\"Aprende m\\u00e1s\",\"zh\":\"\\u5b66\\u5230\\u66f4\\u591a\"},\"link_name2\":{\"en\":\"Learn more\",\"ger\":\"Mehr erfahren\",\"fr\":\"Apprendre encore plus\",\"tr\":\"Daha fazla bilgi edin\",\"pt\":\"Saber mais\",\"ar\":\"\\u062a\\u0639\\u0644\\u0645 \\u0623\\u0643\\u062b\\u0631\",\"bn\":\"\\u0986\\u09b0\\u0993 \\u099c\\u09be\\u09a8\\u09c1\\u09a8\",\"ru\":\"\\u0423\\u0447\\u0438\\u0442\\u044c \\u0431\\u043e\\u043b\\u044c\\u0448\\u0435\",\"es\":\"Aprende m\\u00e1s\",\"zh\":\"\\u5b66\\u5230\\u66f4\\u591a\"},\"link1\":{\"en\":\"#\",\"ger\":null,\"fr\":null,\"tr\":null,\"pt\":null,\"ar\":null,\"bn\":null,\"ru\":null,\"es\":null,\"zh\":null},\"link2\":{\"en\":\"#\",\"ger\":null,\"fr\":null,\"tr\":null,\"pt\":null,\"ar\":null,\"bn\":null,\"ru\":null,\"es\":